import style from './Sixth.module.css'
class Sixth extends Component {
  render() {
    return (
      <div id={style.sixth}>
        <a href='#'  className={style.navbarItems} id={style.aSpotify}>Spotify</a>
      </div>
    )
  }
}

export default Sixth
